import { useEffect, useState } from "react";
import Construct from "./Construct.js";
import ErrorNotification from "./ErrorNotification";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import NavBar from "./Nav.js";
import HomePage from "./HomePage.js";
import LoginPage from "./LoginPage.js";
import SignupPage from "./SignupPage.js";
import AllPlaylist from "./AllPlaylist.js";
import SpotifyRandom from "./SpotifyRandom.js";
import AllSongsInPlayList from "./SongsInPlaylist.js";
import PlayListPage from "./PlayListPage.js";
import GetAllGenres from "./GetAllGenres.js";
import ArtistPage from "./ArtistPage.js";
import AlbumInfo from "./AlbumInfo.js";
import SongInfo from "./SongInfo.js";

function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <div className="container">
        <Routes>
          <Route path="allplaylist">
            <Route index element={<AllPlaylist />} />
            <Route path=":playlist_id" element={<PlayListPage />} />
          </Route>
          <Route path="artist">
            <Route index element={<ArtistPage />} />
            <Route path=":artist_id" element={<ArtistPage />} />
          </Route>
          <Route path="album-info">
            <Route index element={<AlbumInfo />} />
            <Route path=":album_id" element={<AlbumInfo />} />
          </Route>
          <Route path="song-info">
            <Route index element={<SongInfo />} />
            <Route path=":song_id" element={<SongInfo />} />
          </Route>
          <Route path="/spotify/allgenres">
            <Route index element={<GetAllGenres />} />
          </Route>
          <Route path="spotifyRandom">
            <Route index element={<SpotifyRandom />} />
          </Route>
          <Route path="homePage">
            <Route index element={<HomePage />} />
          </Route>
          <Route path="loginPage">
            <Route index element={<LoginPage />} />
          </Route>
          <Route path="signupPage">
            <Route index element={<SignupPage />} />
          </Route>
          <Route path="SignupPage/HomePage" component={HomePage}>
            <Route index element={<HomePage />} />
          </Route>
          <Route path="LoginPage/HomePage" component={HomePage}>
            <Route index element={<HomePage />} />
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
